import React from 'react'

const BlogScreen = () => {
  return (
    <div class='header'>
      <h2>Blog Name</h2>
      <div class='row'>
        <div class='leftcolumn'>
          <div class='card'>
            <h2>TITLE HEADING</h2>
            <h5>Title description, Dec 7, 2017</h5>
            <div class='fakeimg'>Image</div>
            <p>Some text..</p>
          </div>

          <div class='card'>
            <h2>TITLE HEADING</h2>
            <h5>Title description, Dec 7, 2017</h5>
            <div class='fakeimg'>Image</div>
            <p>Some text..</p>
          </div>
        </div>
      </div>
    </div>
  )
}

export default BlogScreen

